Натуральная высококачественная кожа;
- боковые вставки, мягкий кант и язычок из прочной плотной ткани с водонепроницаемым покрытием, для повышения износостойкости верхней части ботинок;
- пластиковая фурнитура: блочки и крупные крючки;
- декоративные элементы: брендовые флажки и репликиты, петли из стропы;
- световозвращающие детали для работы в условиях плохой видимости;
- однослойная подошва выполнена из ПУ, обладает стойкостью к воздействию масел, а также сырой нефти, иных нефтепродуктов, растворов кислот и щелочей, нетоксичной и взрывоопасной пыли;
- подошва имеет широкий температурный диапазон использования от -20 до +80
- мягкий кант деликатно обхватывает щиколотку, препятствует проникновению грязи и пыли внутрь обуви;
- удобная колодка обеспечивает комфорт при длительной носке;
- подносок из композитного материала защищает пальцы ног от механических повреждений с усилием до 200 Дж;

